import { Button } from "react-bootstrap";

class Home extends Component {
  state = {
    counter: 0,
  };

  increment() {
    this.setState({ counter: this.state.counter + 1 });
  }

  render() {
    return (
      <div>
        <h1 className="text-center mt-3">Robot Control Page</h1>
        <Connection />
      </div>
    );
  }
}

export default Home;
